# Function to convert HexDecimal to text string

decode <- function(i){
  s1 <- as.character(i)
  e<-substring(s1, 3)
  str(e)
  h <- sapply(seq(1, nchar(e), by=2), function(x) substr(e, x, x+1))
  result <- rawToChar(as.raw(strtoi(h, 16L)))
  #a1 <- substr(result,1,60)
  #a2 <- substr(result,94,103)
  #result <- paste(a1,a2,sep=",")
  return (result)
}

